import './App.css';
import Logo from './componentes/Logo'

const textoOpcoes = ['CATEGORIAS', 'FAVORITOS', 'MINHA ESTANTE']

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo></Logo>
        <ul className='opcoes'>
          { textoOpcoes.map( (texto) => (
            <li className='opcoes-superios'>{texto}</li>
          ) ) }
        </ul>
      </header>
    </div>
  );
}

export default App;
